import React from 'react';
import SettingsIcon from '@material-ui/icons/Settings';
import BuildIcon from '@material-ui/icons/Build';
import FilterNoneIcon from '@material-ui/icons/FilterNone';
import AnnouncementIcon from '@material-ui/icons/Announcement';
import PaymentIcon from '@material-ui/icons/Payment';
import { Link } from 'react-router-dom';
import { Sidebar } from '../../../components';
import { MenuPopupState } from '../../../components/Account/AccountButton';

export const ContentPage = () => {
	return (
		<div className='page-wrapper'>
			<div className='page-left'>
				<div className='page_sidebar'>
					<Sidebar />
				</div>
			</div>
			<div className='page-right'>
				<div className='page_menu'>
					<MenuPopupState />
				</div>
				<div className='tab__wrapper configuration'>
					<div className='Breadcrumb'>
						<span>
							Cấu Hình <strong>Trang Nội Dung</strong>
						</span>
					</div>
					<div className='TableList table-wrapper'></div>
				</div>
			</div>
		</div>
	);
};
